import history from "../../helper/history";

export const logoutAction = () => {
  return dispatch => {
    // remove user from local storage to log user out
    dispatch({ type: "USER_LOGIN_SUCCESS" });
    localStorage.removeItem("user");
    history.push("/admin");
  };
};

export default logoutAction;
